// Navbar.js
import React from "react";
import "./Navbar.css";
import logo from './../Assest/img/logo.png';

const Navbar = () => {
  return (
    <div className="navbar">
      <img className="logo" src={logo} alt="Logo" />
      <div className="text-wrapper">blood care Nexus</div>

      <ul>
        <li>Home</li>
        <li>Events</li>
        <li>Donor</li>
        <li>Blog</li>
        <li>Blood Recipient</li>
        <li>Contact </li>
        <li>Blood Bank</li>
      </ul>
    </div>
  );
};

export default Navbar;
